function EducationExchangeProgram(name, startDate, endDate, description, type) {
    return(
        <div>
            <h1>{startDate}-{endDate}</h1>
            <h2>{name}</h2>
            <h3>{type}</h3>
            <h3>{description}</h3>
        </div>
    )
}

export default EducationExchangeProgram
